Object(r.a)(JSON.parse('{"ar":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"الأقسام هي وسيلة إضافية لتنظيم المستخدمين. فهي تتيح لك تدريس فئات متعددة من المساق نفسه، بحيث يتوفر لك محتوى المساق كله في مكان واحد. يمكنك أدناه نقل مستخدم إلى مقطع آخر مختلف، أو إضافة/إزالة تسجيلات القسم. يجب أن يكون المستخدمون في قسم واحد على الأقل في كل الأوقات."}}}},"cy":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Mae adrannau’n ffordd ychwanegol o drefnu defnyddwyr. Mae hyn yn gallu gadael i chi ddysgu mwy nag un dosbarth o’r un cwrs, er mwyn cael holl gynnwys y cwrs yn yr un lle. Isod gallwch symud defnyddiwr i adran wahanol, neu ychwanegu/tynnu ymrestriadau ar gyfer adran. Mae’n rhaid i ddefnyddwyr fod yn rhan o un adran o leiaf bob amser."}}}},"da":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Sektioner er endnu en måde til at organisere brugere. Det giver dig muligheden for at undervise flere klasser fra samme fag, så du kan opbevare hele fagindholdet på et enkelt sted. Nedenfor kan du flytte en bruger til en anden sektion, eller tilføje/slette sektionstilmeldinger. Brugerne skal til enhver tid være placeret i mindst en sektion."}}}},"da-x-k12":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Sektioner er endnu en måde til at organisere brugere. Det giver dig muligheden for at undervise flere klasser fra samme fag, så du kan opbevare hele fagindholdet på et enkelt sted. Nedenfor kan du flytte en bruger til en anden sektion, eller tilføje/slette sektionstilmeldinger. Brugerne skal til enhver tid være placeret i mindst en sektion."}}}},"de":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Abschnitte sind eine weitere Möglichkeit, um Benutzer zu organisieren. Sie ermöglichen es Ihnen, mehrere Klassen im gleichen Kurs zu unterrichten, so dass Sie alle Kursinhalte an einem zentralen Punkt speichern können. Unten können Sie einen Benutzer in einen anderen Abschnitt verschieben oder Einschreibungen für Abschnitte hinzufügen/entfernen. Benutzer müssen immer zu mindestens einem Abschnitt gehören."}}}},"el":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"\\u003cmrk mid=\\"6641\\" mtype=\\"seg\\"\\u003eΟι τομείς είναι άλλος ένας τρόπος οργάνωσης των χρηστών.\\u003c/mrk\\u003e \\u003cmrk mid=\\"6642\\" mtype=\\"seg\\"\\u003eΣας επιτρέπει να διδάσκετε πολλαπλές ομάδες για το ίδιο μάθημα, ώστε όλο το περιεχόμενο του μαθήματος να βρίσκεται σε ένα σημείο.\\u003c/mrk\\u003e \\u003cmrk mid=\\"6643\\" mtype=\\"seg\\"\\u003eΠαρακάτω μπορείτε να μεταφέρετε κάποιον χρήστη σε διαφορετικό τομέα ή/και να προσθέσετε/αφαιρέσετε εγγραφές στον τομέα.\\u003c/mrk\\u003e \\u003cmrk mid=\\"6644\\" mtype=\\"seg\\"\\u003eΟι χρήστες θα πρέπει να βρίσκονται όλοι τουλάχιστον σε έναν τομέα την ίδια στιγμή.\\u003c/mrk\\u003e"}}}},"en-AU":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Sections are an additional way to organize users. This can allow you to teach multiple classes from the same course, so that you can have the course content all in one place. Below you can move a user to a different section, or add/remove section enrolments. Users must be in at least one section at all times."}}}},"en-CA":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Sections are an additional way to organize users. This can allow you to teach multiple classes from the same course, so that you can have the course content all in one place. Below you can move a user to a different section, or add/remove section enrollments. Users must be in at least one section at all times."}}}},"en-GB":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Sections are an additional way to organise users. This can allow you to teach multiple classes from the same course, so that you can have the course content all in one place. Below you can move a user to a different section, or add/remove section enrolments. Users must be in at least one section at all times."}}}},"es":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Las secciones son formas adicionales de organizar usuarios. De este modo, podrá impartir el mismo curso a varias clases diferentes y mantener el contenido del curso en un solo lugar. A continuación podrá mover un usuario a una sección diferente o agregar/eliminar inscripciones de una sección. Los usuarios deben estar en al menos una sección en todo momento."}}}},"fa":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"بخش ها روش دیگری برای سازماندهی کاربران هستند. این روش شما امکان می دهد چند کلاس را از یک درس تدریس کنید، تا کل محتوای درس را یکجا داشته باشید. در قسمت زیر می توانید یک کاربر را به یک بخش دیگر منتقل کنید، یا ثبت نام های بخش را حذف یا اضافه کنید. کاربران همیشه باید حداقل در یک بخش باشند."}}}},"fi":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Osat ovat lisätapa käyttäjien järjestämiseen. Tämä voi mahdollistaa useiden luokkien opettamisen samasta kurssista, niin että sinulla on kaikki kurssisisältö yhdessä paikassa. Alla voit siirtää käyttäjän eri osaan tai lisätä/poistaa osan ilmoittautumiset. Käyttäjien täytyy olla vähintään yhdessä osassa kaikkina aikoina."}}}},"fr":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Les sections constituent une méthode supplémentaire d’organisation des utilisateurs. Elles vous permettent de dispenser le même cours à plusieurs classes et donc de stocker le contenu du cours à un seul endroit. Ci-dessous, vous pouvez déplacer un utilisateur dans une autre section ou ajouter/supprimer des inscriptions aux sections. Les utilisateurs doivent toujours se trouver au moins dans une section."}}}},"fr-CA":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Les sections constituent une méthode supplémentaire d’organisation des utilisateurs. Elles vous permettent de dispenser le même cours à plusieurs classes et donc de stocker le contenu du cours à un seul endroit. Ci-dessous, vous pouvez déplacer un utilisateur dans une autre section ou ajouter/supprimer des inscriptions aux sections. Les utilisateurs doivent toujours se trouver au moins dans une section."}}}},"he":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"הקבצות הן דרך נוספת לארגן משתמשים. הדבר יאפשר ללמד כיתות מרובות מאותו הקורס, כך שניתן להשתמש באותו תוכן קורס בכל המקומות. ניתן להעביר תלמיד להקבצה אחרת, או להוסיף/ להסיר הרשמות לסעיף בדף מתחת. תלמידים חייבים להיות לפחות בהקבצה אחת בכל רגע נתון."}}}},"ht":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Seksyon yo se yon mwayen anplis pou òganize itilizatè yo. Sa kapab pèmèt ou anseye plizyè klas nan menm kou a, konsa w ap gen tout kontni kou a yon sèl kote. Pi ba a ou kapab mete yon itilizatè nan yon lòt seksyon, oswa ajoute/elimine enskripsyon seksyon yo. Pandan tout tan yo itilizatè yo dwe nan yon seksyon pou pi piti."}}}},"hu":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"A szekciók létrehozása egy további lehetőséget biztosít a felhasználók csoportosítására. Lehetővé teszi, hogy több csoportot tanítson ugyanazon kurzuson belül, oly módon, hogy az összes kurzustartalom egy helyen legyen. Az alábbi részen felhasználókat tud mozgatni egy másik szekcióba, vagy hozzáadni/eltávolítani szekcióbeiratkozásokat. A felhasználóknak legalább egy szekcióban jelen kell lenniük."}}}},"hy":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Բաժինները օգտատերերի հետ աշխատանքը կազմակերպելու լրացուցիչ միջոց են: Դրանք կարող են Ձեզ թույլ տալ միևնույն դասընթացի շրջանակում մի քանի դաս վարել, այնպես որ դուք կարողանաք դասընթացի բովանդակությունը տեղադրել մի տեղում: Ներքևում Դուք կարող եք օգտատիրոջը տեղափոխել մեկ այլ բաժին կամ ավելացնել/հանել բաժնի գրանցումները: Օգտատերերը պետք է մշտապես ընդգրկված լինեն առնվազն մեկ բաժնում:  "}}}},"is":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Með hlutum er hægt að skipuleggja notendur. Þannig geturðu kennt mörgum hópum á sama námskeiði og haft allt efni námskeiðs á einum stað. Fyrir neðan geturðu flutt notanda í annan hluta eða bætt við/fjarlægt skráningar í hluta. Notendur verða alltaf að vera í minnst einum hluta."}}}},"it":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Le sezioni sono una risorsa aggiuntiva per organizzare gli utenti. Questo ti consente di insegnare in più classi dello stesso corso, così puoi avere tutto il contenuto del corso in un unico posto. Di seguito puoi spostare un utente in una sezione diversa o aggiungere/rimuovere le iscrizioni della sezione. Gli utenti devono essere sempre in almeno una sezione."}}}},"ja":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"セクションはユーザの編成手段の 1 つです。セクションを利用するとで、1 つのコースで複数のクラスを教えることができ、コースの内容を 1 箇所にまとめることができます。以下では、ユーザを別のセクションに移動したり、セクションの登録を追加/削除できます。ユーザは常に 1 つ以上のセクションに含まれる必要があります。"}}}},"ko":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"섹션은 사용자를 구성하는 추가적인 방법입니다. 이를 이용하면 같은 과목으로부터 여러 학급을 가르칠 수 있어서 과목 내용을 모두 한 곳에 둘 수 있습니다. 아래에서 사용자를 다른 섹션으로 옮기거나 섹션 등록을 추가/제거할 수 있습니다. 사용자는 항상 적어도 하나 이상의 섹션에 속해야 합니다."}}}},"mi":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Ko te Wāhanga te ara atu ki te whakarite i ngā kaiwhakamahi. Ka taea koe te whakaako akomanga maha i te akoranga kotahi, ka taea koe te whai i te ihirangi akoranga i roto i te wāhi kotahi. Kei raro ka taea e koe te neke i te kaiwhakamahi ki te wāhanga rerekē, rānei tāpiri / tango wāhanga whakaurunga. Ngā Kaiwhakamahi i roto i te iti rawa kia kotahi te wāhanga i ngā wā katoa."}}}},"nb":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Seksjon er en ekstra måte å organisere brukere på. Dette lar deg undervise flere seksjon i samme emne, så du kan ha alt emnemateriellet på ett sted. Nedenfor kan du flytte en bruker til en annen klasse, eller legge til/fjerne klassepåmeldinger. Brukere må alltid være i minst én klasse."}}}},"nb-x-k12":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Seksjon er en ekstra måte å organisere brukere på. Dette lar deg undervise flere seksjon i samme fag, så du kan ha alt fagmateriellet på ett sted. Nedenfor kan du flytte en bruker til en annen klasse, eller legge til/fjerne klassepåmeldinger. Brukere må alltid være i minst én klasse."}}}},"nl":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Secties zijn een extra manier om gebruikers in te delen. Je kunt hiermee aan meerdere groepen lesgeven vanuit dezelfde cursus zodat je alle cursusinhoud op één plek hebt. Hieronder kun je een gebruiker naar een andere sectie verplaatsen of sectie-inschrijvingen toevoegen/verwijderen. Gebruikers moeten altijd in minstens één sectie ingedeeld zijn."}}}},"nn":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Seksjonar er ein annan måte å organisere brukarar på. Dette gjer at du kan undervise fleire seksjonar i det same emnet, og ha alt emneinnhaldet på same plass. Nedanfor kan du flytte ein brukar til ei anna seksjon, eller legge til/fjerne seksjonspåmeldingar. Brukarane må vere i minst eit område til kvar tid."}}}},"pl":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Sekcje są dodatkowym sposobem na organizowanie uczestników. Pozwala to na nauczanie wielu klas w ramach jednego kursu, tak że można mieć całą zawartość kursu w jednym miejscu. Poniżej możesz przesunąć uczestnika do innej sekcji, lub dodać/usunąć zapisy do sekcji. Użytkownicy muszą być w co najmniej jednej sekcji przez cały czas."}}}},"pt":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"As secções são uma forma adicional de organizar utilizadores. Isso pode permitir ensinar em várias turmas da mesma disciplina, para poder ter o conteúdo da disciplina num só lugar. Abaixo, pode mover um utilizador para uma secção diferente ou adicionar/remover matrículas na secção. Os utilizadores devem estar em pelo menos uma secção."}}}},"pt-BR":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"As seções são uma maneira adicional de organizar usuários. Isso permite que você dê várias aulas a partir do mesmo curso, de modo que você tenha todo o conteúdo do curso em um único lugar. Abaixo você pode mover um usuário para uma seção diferente ou adicionar/remover matrículas de seção. Os usuários devem estar, pelo menos, em uma seção o tempo todo."}}}},"ru":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Разделы являются дополнительным способом организации пользователей. Это позволит вам преподавать в нескольких классах того же курса. Таким образом, вы можете хранить содержимое курса в одном месте. Ниже вы можете перемещать пользователя в другой раздел или добавить/удалить регистрации в разделе. Пользователи все время должны быть, по крайней мере, в одном разделе."}}}},"sl":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Sekcije so dodaten način za organiziranje uporabnikov. Na ta način lahko poučujete več razredov iz istega predmeta, tako da imate celotno vsebino predmeta na enem mestu. Spodaj lahko uporabnika premaknete v drugo sekcijo ali pa dodajate/odstranjujete vpise sekcije. Uporabniki morajo vedno biti vsaj v eni sekciji."}}}},"sv":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Sektioner är ett ytterligare sätt att organisera användare på. Det gör att du kan undervisa flera klasser från samma kurs så att du kan ha allt kursinnehåll på samma plats. Nedanför kan du flytta en användare till en annan sektioner, eller lägga till/ta bort sektionsregistreringar. Användare måste alltid finnas i minst en sektion."}}}},"sv-x-k12":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Sektioner är ett ytterligare sätt att organisera användare på. Det gör att du kan undervisa flera klasser från samma kurs så att du kan ha allt kursinnehåll på samma plats. Nedanför kan du flytta en användare till en annan sektioner, eller lägga till/ta bort sektionsregistreringar. Användare måste alltid finnas i minst en sektion."}}}},"tr":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Bölümler kullanıcıları bütünleştirmenin ilave bir yoludur. Aynı ders içerisinde çoklu öğretim sınıflarına izin verilir, bu sayede tüm ders içerikleri tek bir yerde bulunur. Kullanıcıyı farklı bölüme taşımak veya bölüm kayıdı eklemek/silme işlemlerini yapabilirsiniz. Kullanıcılar en az bir bölümde olmalıdırlar."}}}},"uk":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"Секції є додатковим способом організації користувачів. Це може дозволити вам навчити кілька класів з того ж курсу, так що ви можете мати вміст курсу в одному місці. Нижче ви можете перемістити користувача в інший розділ, або додати / видалити розділ контингенту слухачів. Користувачі повинні мати принаймні один розділ в будь-який час."}}}},"zh-Hans":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"班级是组织用户的另一种方式。通过它，您可以为多个参加同一门课程的班级授课，这样您就可以将课程内容都保存在同一位置。在下面，您可以将用户移至其它班级，或添加/删除班级的注册。 用户必须始终至少位于一个班级。"}}}},"zh-Hant":{"courses":{"roster":{"edit_sections_view":{"edit_sections_desc":"班別是組織使用者的另一種方式。這可允許您為多個班級教授相同的課程，這樣您就可以將所有課程內容置於一個地方。在下面，您可以移動使用者到不同的班別，或添加/刪除班別註冊。使用者必須始終至少位於一個班別內。"}}}}}'))
